  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:49.881363\",\n\t\"name\": \"contaminant-concentrations-in-florida-raptor-eggs\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Inviable eggs from the nests of Florida
  bald eagles and ospreys were collected opportunistically from 1987 through 1989.
  Egg contents were analyzed for organochlorine pesticide (OC), polychlorinated biphenyl
  (PCB) and heavy metal concentrations. The only organic contaminant found in all
  eggs was p,p'-DDE (range=0.27-4.9 ug/g wet weight). Both the lowest and highest
  levels were in bald eagle eggs. All bald eagle eggs but one contained above-detection
  limit levels of oxychlordane, heptachlor epoxide, trans-nonachlor, p,p'-DDD and
  PCBs. Polychlorinated biphenyl concentrations ranged from \"not detected\" to 34
  ug/g in eagle eggs (the latter is the highest PCB concentration reported from Florida)
  and from 2.1 to 3.1 ug/g in osprey eggs. Mercury concentrations (range=0.12-0.60
  ug/g wet weight) were less than those known to cause reproductive impairment; however,
  selenium concentrations (range=0.33-0.86 ug/g wet weight), with the exception of
  one eagle egg and one osprey egg, were within the range known to cause reproductive
  impairment.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
